import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form>
          <label>Digite seu nome</label><br></br>
          <input></input>
        </form>
        <p>
         Portfolio Lucas da Costa :)
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
         Aprender mais
        </a>
      </header>
    </div>
  );
}

export default App;
